  [],\n\t\"revision_timestamp\": \"2015-09-27T00:03:05.045688\",\n\t\"name\": \"noaa-office-for-coastal-management-coastal-inundation-digital-elevation-model-brownsville-texas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This digital elevation model (DEM) is a
  part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
  Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
  The DEM includes the best available lidar data known to exist at the time of DEM
  creation that meets project specifications for those counties within the boundary
  of the Brownsville TX Weather Forecast Office (WFO), as defined by the NOAA National
  Weather Service. The counties within this boundary are: Cameron, Willacy, and Kenedy.
  For Cameron and Willacy counties the DEM is derived from LiDAR data sets collected
  for the Texas Water Development Board (TWDB) in 2005 and 2006 with a point density
  of 1.4 m GSD. The LiDAR data for Kenedy County is based on the US Geological Survey
  (USGS) National Elevation Dataset (NED) 1/9 arc-second elevation data. Hydrographic
  breaklines used in the creation of the DEM were delineated using LiDAR intensity
  imagery generated from the data sets. Hydrography for Kenedy County is based on
  the National Hydrography Dataset (NHD) and the National Wetlands Inventory (NWI).
  The DEM is hydro flattened such that water elevations are less than or equal to
  0 meters. The DEM is referenced vertically to the North American Vertical Datum
  of 1988 (NAVD88) with vertical units of meters and horizontally to the North American
  Datum of 1983 (NAD83). The resolution of the DEM is approximately 10 meters.\",\n\t\"license_title\":
